package com.fishercoder;


import _686.Solution1;
import _686.Solution2;
import org.junit.Assert;
import org.junit.Test;


public class _686Test {
    private static Solution1 solution1;

    private static Solution2 solution2;

    @Test
    public void test1() {
        Assert.assertEquals(3, _686Test.solution1.repeatedStringMatch("abcd", "cdabcdab"));
        Assert.assertEquals(3, _686Test.solution2.repeatedStringMatch("abcd", "cdabcdab"));
    }

    @Test
    public void test2() {
        Assert.assertEquals(1, _686Test.solution1.repeatedStringMatch("aa", "a"));
        Assert.assertEquals(1, _686Test.solution2.repeatedStringMatch("aa", "a"));
    }

    @Test
    public void test3() {
        Assert.assertEquals(2, _686Test.solution1.repeatedStringMatch("a", "aa"));
        Assert.assertEquals(2, _686Test.solution2.repeatedStringMatch("a", "aa"));
    }

    @Test
    public void test4() {
        Assert.assertEquals((-1), _686Test.solution1.repeatedStringMatch("abcabcabcabc", "abac"));
        Assert.assertEquals((-1), _686Test.solution2.repeatedStringMatch("abcabcabcabc", "abac"));
    }

    @Test
    public void test5() {
        Assert.assertEquals((-1), _686Test.solution1.repeatedStringMatch("abaabaa", "abaababaab"));
        Assert.assertEquals((-1), _686Test.solution2.repeatedStringMatch("abaabaa", "abaababaab"));
    }

    @Test
    public void test6() {
        Assert.assertEquals((-1), _686Test.solution1.repeatedStringMatch("", ""));
        Assert.assertEquals((-1), _686Test.solution2.repeatedStringMatch("", ""));
    }
}

